def get_path(module: ModuleType) -> str:
    # Get the module's file attribute
    module_file = getattr(module, '__file__', None)

    if module_file is None:
        return "Module does not have a file attribute."

    # Handle frozen modules (like those created by PyInstaller)
    if hasattr(module, '__path__'):
        return str(Path(module.__path__[0]))

    # For regular modules, return the directory of the module file
    return str(Path(module_file).parent)

