def find_available_providers(modules: List[ModuleType]) -> List[str]:
    available_providers = []

    for module in modules:
        package_name = module.__name__
        package_path = Path(module.__file__).parent

        for _, submodule_name, is_pkg in pkgutil.iter_modules([str(package_path)]):
            if not is_pkg and '__pycache__' not in submodule_name:
                full_module_name = f"{package_name}.{submodule_name}"
                available_providers.append(full_module_name)

    return sorted(available_providers)

